import React from 'react'

function Namelist() {
	const persons = [
    {
     id: 1,
     name: 'Abhi',
     age:'25',
     skill:'React'
     
     },

     {
     id: 2,
     name: 'Aditya',
     age:'40',
     skill:'java'
     
     },

     {
     id: 3,
     name: 'Sonam',
     age:'50',
     skill:'node'
     
     },
 ]

 const personList = persons.map(person => (

 	<h2>I am {person.name}, I am {person.age} years old. I know {person.skill}</h2>

 	))
 return <div>{personList}</div>
	 
}

export default Namelist
